class deckOfCards {
    constructor(_data) {
        this.data = _data;
    }
    print() {
        for (let item of this.data) {
            let cardItem = new card(item);
            cardItem.getHtml();
        }
    }
}

function shuffleSort(array) {
    for (let i = array.length - 1; i > 0; i--) {
        let j = Math.floor(Math.random() * (i + 1));
        [array[i], array[j]] = [array[j], array[i]];
    }
}
shuffleSort(cardsArr);
const cardsOnTable = new deckOfCards(cardsArr);
cardsOnTable.print();

const cols = document.getElementsByClassName("col-2");
let col = 0;
let heigth = 0;
function play() {
    cols[col].classList.add("move");
    cols[col].classList.remove("start");
    col++;
    window.scrollTo({
        top: heigth,
        behavior: "smooth"
    });
    heigth += 30;
    if (col < cols.length) {
        setTimeout(play, 100)
    }
    if (document.getElementsByClassName("start").length === 0) {
        document.getElementsByClassName("start-card")[0].style.display = "none";
        window.scrollTo({
            top: 0,
            behavior: "smooth"
        });
        document.getElementById("caption").style.display = "block";
        document.getElementById("caption").classList.add("animate__animated", "animate__swing");
        document.getElementsByClassName("table")[0].classList.remove("table-block");
    }
}
const cards = document.getElementsByClassName("card");
for (let card of cards) {
    card.addEventListener("click", function chooseCard() {
        this.setAttribute("style", "animation: cardRotate 1s ease;");
        this.getElementsByClassName("card__front")[0].setAttribute("style", "transform: rotateY(180deg);");
        this.getElementsByClassName("card__back")[0].setAttribute("style", "transform: rotateY(360deg);");
        setTimeout(modalAppear, 1500)

    })
}
function modalAppear() {
    document.getElementById("caption").style.display = "none";
    document.getElementsByTagName("body")[0].style.overflowY = "hidden";
    document.getElementById("modal").classList.remove("hidden");
}
function modalClose() {
    document.location.reload(true);
}